import React from 'react'
import './style/Video.css';
import Stream from './Stream';


function VideoPage(){
    var position1 = true;
    var position2 = false;
    var position3 = false;
    var position4 = false;

    function togglePosition1(){
        position1 = !position1;
    };

    function togglePosition2() {
    position2 = !position2;
    };

    function togglePosition3() {
    position3 = !position3;
    };

    function togglePosition4() {
    position4 = !position4;
    };

    return(
        <div className="Video">
            <h4>VIDEO</h4>

            { position1 &&
            <div className="Position1">
                <Stream />
            </div>
            }
            { position2 &&
            <div className="Position2">
                <Stream />
            </div>
            }
            { position3 &&
            <div className="Position3">
                <Stream />
            </div>
            }
            { position4 &&
            <div className="Position4">
                <Stream />
            </div>
            }

        </div>
    );
}

export default VideoPage
